                                                   <p class="ij-OfferCardContent-description-description ij-OfferCardContent-description-description--hideOnMobile">Empresa  líder en tratamiento de cuarzo y ámbito internacional busca incorporar un/una pulidor/a para su equipo de elaboración.
                                                      Funciones principales del puesto:
                                                      -	Realizar las gestiones necesarias para dar comienzo al proceso de pulido
                                                      -	Ejecutar el ajuste de las calibradoras según la producción
                                                      -	Ejecutar el ajuste de las pulidoras según la producción
                                                      -	Comprobar que las pulidoras tienen los abrasivos necesarios para su funcionamiento
                                                      -	Organizar y ejecutar con el equipo de elaboración las limpiezas y mantenimientos diarios de las máquinas y los espacios relativos a los puestos de trabajo
                                                      -	Reportar incidencias diarias en elaboración a su encargado
                                                      -	Realizar el seguimiento de la línea y resolver las incidencias de la pulidora y calibradora.
                                                      -	Verificar la calidad de las piezas de trabajo terminadas inspeccionando, comparando con plantillas, midiendo dimensiones y marcando cualquier defecto para un posible reproceso
                                                      -	Garantizar el uso de EPIs y de que se sigan todos los procesos de seguridad de la compañía
                                                      -	Realizar otras tareas asignadas por su superior
                                                   </p>
