ive\":false},{\"code\":\"a332c2425b4236a2ada9480a976b73\",\"title\":\"QA Engineer (TELETRABAJO)\",\"description\":\"- Estudios m\u00EDnimos\\r\\nIngenier\u00EDas T\u00E9cnicas (inform\u00E1tica, telecomunicaciones, industrial, \u00BF). No se descartan candidatos con otros estudios, pero con una alta experiencia como ingeniero QA.\\r\\n\\r\\n- Experiencia m\u00EDnima: Al menos 3 a\u00F1os\\r\\n\\r\\n- Se har\u00E1 una contrataci\u00F3n inicial hasta el 31 de diciembre, si la colaboraci\u00F3n va bien, el contrato se extender\u00E1.\\r\\n\\r\\n- Conocimientos necesarios\\r\\nRealizaci\u00F3n de test unitarios, test de integraci\u00F3n, test de regression y test \u00BFend-to-end\u00BF.\\r\\nHerramientas de integraci\u00F3n continua: Selenium, Jenkins, GitLab, \u00BF\\r\\nLenguajes programaci\u00F3n (asp.NET, Android, iOS, \u00BF).\\r\\nBases de datos (SQL y No SQL)\\r\\n\\r\\n- Requisitos m\u00EDnimos\\r\\nExperiencia m\u00EDnima de 3 a\u00F1os en puestos similares.\\r\\nNivel de ingl\u00E9s m\u00EDnimo B2.\\r\\nExperiencia en herramientas de gesti\u00F3n de proyectos colaborativos: Jira, MS Teams, \u00BF\\r\\nPersona proactiva, aut\u00F3noma, con capacidad de aprendizaje, acostumbrada a trabajar en equipos remotos online, multidisciplinares y bajo metodolog\u00EDas \u00C1giles (SCRUM).\\r\\nDescripci\u00F3n\\r\\nEstamos seleccionando candidatos para un puesto de \u00BFQuality Assurance Tester\u00BF para trabajar en los equipos de proyectos de digitalizaci\u00F3n de construcci\u00F3n de Infraestructuras para empresa multinacional. La principal misi\u00F3n del puesto \u00BFQuality Assurance Tester\u00BF ser\u00E1 asegurar la calidad del producto desarrollado para el cliente.\\r\\n\\r\\n- Responsabilidades:\\r\\nEntender, implementar y mantener actualizada la estrategia \u00BFAgile Testing\u00BF\\r\\nTrabajar con el \u00BFProduct Owner\u00BF para definir los criterios de aceptaci\u00F3n y las definiciones de \u00BFhecho\u00BF de las historias de usuario.\\r\\nDesarrollar el \u00BFtest plan\u00BF a partir de las historias de usuarios, as\u00ED como la redacci\u00F3n de \u00BFTest Cases\u00BF y la l\u00EDnea base para las pruebas de aceptaci\u00F3n.\\r\\nEstimar, priorizar, planificar y coordinar actividades de testing.\\r\\nAsegurar que el equipo de trabajo conozca y use adecuadamente las herramientas de \u00BFtesting\u00BF.\\r\\nConfigurar, usar y gestionar los entornos de testing.\\r\\nDise\u00F1ar, desarrollar y ejecutar scripts de automatizaci\u00F3n.\\r\\nEjecutar Test Cases incluyendo pruebas manuales y automatizadas del sistema contra los requisitos (funcionales y no funcionales).\\r\\nGestionar la calidad del c\u00F3digo y la deuda t\u00E9cnica.\\r\\nReportar los errores (bugs) y trabajar con los desarrolladores en su resoluci\u00F3n.\\r\\nLlevar a cabo testing de regresiones cuando los bugs se hayan resuelto.\\r\\nHacer coaching a otros miembros del equipo en los aspectos relevantes al Agile Testing.\\r\\nAsegurar que las actividades de Testing sean incluidas en la planificaci\u00F3n de la iteraci\u00F3n y de salidas a producci\u00F3n (Releases).\\r\\nParticipar proactivamente en las reuniones diarias (Daily Standup), sesiones para el desarrollo de historias de usuario, planificaci\u00F3n y en retrospectivas, sugiriendo e implementando mejoras.\",\"city\":\"Barcelona\",\"link\":\"//www.infojobs.net/barcelona/qa-engineer-teletrabajo/of-ia332c2425b4236a2ada9480a976b73?applicationOrigin=search-new&page=2&sortBy=PUBLICATION_DATE\",\"contractType\":\"Contrato de duraci\u00F3n determinada\",\"workday\":\"Jornada completa\",\"publishedAt\":\"2020-08-31T11:30:03Z\",\"companyName\":\"CAMPAMENTO INTERIOR SL.\",\"companyLink\":\"https://www.infojobs.net/campamento-interior-sl./em-i98535449485154676577808020104377601882\",\"states\":[\"REUSED\"],\"upsellings\":[\"BUMP_WEEKLY\",\"MULTI_PROVINCE\"],\"executive\":false},{\"code\":\"cbe96fcca4464aac2d9d3458ab30e6\",\"title\":\"busco fisioteraputa\",\"description\":\"Busco fisioterapeuta co